 function getContestData(){
  const Data =  fetch('https://kontests.net/api/v1/all')
  const Contest =  Data.json();
  return Contest;
}

function App() {
  const data = getContestData();
  var ret = " ";
  data.then(dat => ret+=dat[0].name);

}

export default App;
